    /// Save data in File1 and File2
    /// Read line by line - each line is an information about one company
    /// First read company name in reporting_structure.reporting_plans[0].plan_name - between 1st and 2nd minus, e.g. LIVE HEALTH ONLINE - PARTNER FUND SERVICES LLC - ANTHEM
    /// Then read each record in in_network_files array (description and location), find location id from File2
    /// Save company name, EIN, description, locationid in File1
    /// </summary>
    /// <param name="jsonFilePath"></param>
    public void ParseAnthemFullFile(string jsonFilePath)
    {
        int index = 0;
        int skip = 0;

        TimeJournal.SetLogFilePath("File1.csv");
        List<string> fileURLs = new();

        using (StreamReader reader = new StreamReader(jsonFilePath))
        {
            string line;
            while ((line = reader.ReadLine()) != null)
            {
                index++;
                if (line.StartsWith("{\"reporting_plans\""))
                {
                    try
                    {
                        AnthemObject obj = ParseOneCompany(line);
                        string companyName = "";
                        string planid = "0";
                        if (obj.ReportingPlans != null && obj.ReportingPlans.Length > 0)
                        {
                            foreach (ReportingPlan plan in obj.ReportingPlans)
                            {
                                // find company name from reporting plans - it is not always in the first one
                                if (!string.IsNullOrEmpty(plan.PlanIdType) && !string.IsNullOrEmpty(plan.PlanName))
                                {
                                    planid = plan.PlanId;
                                    companyName = GetCompanyName(plan.PlanName);
                                    break;
                                }
                            }
                        }

                        if (string.IsNullOrEmpty(companyName))
                        {
                            CustomConsole.WriteLine($"Company name is empty in line {index}");
                            continue;
                        }

                        foreach (AnthemObjectFile fileCollection in obj.InNetworkFiles)
                        {

                            string description = fileCollection.Description;
                            foreach (AnthemFileStructure file in fileCollection.Files)
                            {
                                if (skip-- > 0)
                                    continue;
                                Uri uri = new Uri(file.Url);
                                string path = uri.GetLeftPart(UriPartial.Path);     // get url without query string

                                // find location id from File2
                                if (!fileURLs.Contains(path))
                                {
                                    fileURLs.Add(path);
                                }

                                int locationId = fileURLs.IndexOf(path);
                                TimeJournal.Write(new object[] { companyName, planid /*EIN*/, description, locationId });
                            }
                        }
                    }
                    catch (Exception ex)
                    {
                        CustomConsole.WriteLine(ex.Message);
                    }
                }
                if (index % 1000 == 0)
                    CustomConsole.Write(".");
                if (index % 1000 == 0)
                {
                    CustomConsole.WriteLine($"Break");
                    break;
                }
            }
            reader.Close();

            // save File2
            TimeJournal.SetLogFilePath("File2.csv");
            for (int i = 0; i < fileURLs.Count; i++)
            {
                TimeJournal.Write(new object[] { i, fileURLs[i] });
            }
        }
        CustomConsole.WriteLine($"Index: {index}");
    }

    public string GetCompanyName(string line)
    {
        string[] parts = line.Split('-');
        if (parts.Length > 2)
        {
            return parts[1].Trim();
        }
        return "";
    }


    private AnthemObject ParseOneCompany(string json)
    {
        if (json.EndsWith(","))
        {
            json = json.Substring(0, json.Length - 1);
        }

        ReportingStructure? data = JsonConvert.DeserializeObject<ReportingStructure>(json);
        AnthemObject anthemObject = new AnthemObject();
        anthemObject.ReportingPlans = data.ReportingPlans.ToArray();
        anthemObject.InNetworkFiles = new List<AnthemObjectFile>();

        foreach (InNetworkFile f in data.InNetworkFiles)
        {
            string desc = CleanupString(f.Description);
            string url = f.Location;
            string location = CleanupString(ParseLocation(f.Location));
            AnthemObjectFile? file = anthemObject.InNetworkFiles.FirstOrDefault(x => x.Description == desc);
            if (file != null)
            {
                file.Files.Add(new AnthemFileStructure { File = location, Url = url });
            }
            else
            {
                file = new AnthemObjectFile();
                file.Description = desc;
                file.Files = new List<AnthemFileStructure> { new AnthemFileStructure { File = location, Url = url } };
                anthemObject.InNetworkFiles.Add(file);
            }
        }

        return anthemObject;
    }

    private static string CleanupString(string input)
    {
        return input.Replace("\"", "").Replace(":", "_").Replace(" ", "_").Replace("/", "_").Replace(",", ".").Trim();
    }

    public void PrintCompany(AnthemObject anthemObject)
    {
        // print contents of anthemObject to CustomConsole
        CustomConsole.WriteLine("-- Plans --");
        foreach (ReportingPlan p in anthemObject.ReportingPlans)
        {

            CustomConsole.WriteLine($"PlanName: {p.PlanName}");
            CustomConsole.WriteLine($"PlanIdType: {p.PlanIdType}");
            CustomConsole.WriteLine($"PlanId: {p.PlanId}");
            CustomConsole.WriteLine($"PlanMarketType: {p.PlanMarketType}");
        }

        CustomConsole.WriteLine("-- Files --");
        anthemObject.InNetworkFiles.Sort((x, y) => x.Description.CompareTo(y.Description));
        foreach (AnthemObjectFile f in anthemObject.InNetworkFiles)
        {
            CustomConsole.WriteLine($"Description: {f.Description}");

            // compare f.Files using SortFileXofY function
            f.Files.Sort(SortFileXofY);

            foreach (AnthemFileStructure file in f.Files)
            {
                CustomConsole.WriteLine($"  {file.File}");
            }
        };
    }

    public List<Task> DownloadOneCompany(AnthemObject anthemObject, string rootDir)
    {
        List<Task> tasks = new List<Task>();
        foreach (AnthemObjectFile file in anthemObject.InNetworkFiles)
        {
            for (int i = 0; i < file.Files.Count; i++)
            {
                string dir = Path.Combine(rootDir, file.Description);
                Directory.CreateDirectory(rootDir);
                Directory.CreateDirectory(dir);

                FileDownloader.DownloadFileAsync(file.Files[i].Url, dir, file.Files[i].File);
            }
        }
        return tasks;
    }

    private (int, int, string) FindOfIndex(string line)
    {
        int X = 0, Y = 0;
        string prefix = line;

        // parsing string _23_of_35.
        int ofIndex = line.IndexOf("_of_");
        if (ofIndex > 0)
        {
            prefix = line.Substring(0, ofIndex - 1);

            int start = ofIndex + 4;
            int end = line.IndexOf(".", start);
            string number = line.Substring(start, end - start);
            Y = int.Parse(number);

            start = end = ofIndex - 1;
            while (start > 1 && line[start - 1] != '_')
            {
                start--;
            }
            number = line.Substring(start, end - start + 1);
            X = int.Parse(number);
        }
        else
        {
            // TODO: parse 01_02.json
        }

        return (X, Y, prefix);
    }
    private int SortFileXofY(AnthemFileStructure s1, AnthemFileStructure s2)
    {
        string prefix1, prefix2;
        int x1, y1;
        (x1, y1, prefix1) = FindOfIndex(s1.File);
        int x2, y2;
        (x2, y2, prefix2) = FindOfIndex(s2.File);

        if (y1 == 0 && y2 == 0)
            return s1.File.CompareTo(s2.File);

        if (y1 != y2)
            return y1.CompareTo(y2);

        if (prefix1 != prefix2)
            return prefix1.CompareTo(prefix2);

        return x1.CompareTo(x2);
    }

    private string ParseLocation(string location)
    {
        // parse url
        Uri uri = new Uri(location);
        string path = uri.AbsolutePath;
        if (path.StartsWith("/"))
            path = path.Substring(1);

        return path;
    }

    public static async Task<long?> GetFileSizeAsync(HttpClient client, string url)
    {
        using (HttpRequestMessage request = new HttpRequestMessage(HttpMethod.Head, url))
        using (HttpResponseMessage response = await client.SendAsync(request))
        {
            if (response.IsSuccessStatusCode)
            {
                return response.Content.Headers.ContentLength;
            }
        }

        return null;
    }
